import './App.css';
import React, { useState, useEffect } from 'react';
import axios, { Axios } from 'axios';

//import fs from 'fs';
import ResponseQuestions from './ResponseElements/ResponseQuestions';
import { type } from '@testing-library/user-event/dist/type';
var retrievedData;
var rawQuestions = [];




function ResponseApp() {
  //const[questions, setQuestions] = useState([]);
  // const addQuestionHandler = question => {
  //   setQuestions((prevQuestions) => {
  //     return [...prevQuestions, question ];
  //     console.log(question);
  //   });
  // }
  const [questions, setQuestions] = useState([]);
  useEffect(()=> {
    axios.get('http://localhost:3001/api/get').then((response) => {
      retrievedData = response.data;
      console.log(retrievedData); // Log the entire response data to see its structure
      console.log(retrievedData[0].questions)
      //console.log(retrievedData[0].questions)
      rawQuestions = JSON.parse(retrievedData[0].questions);
      console.log('questions:')
      console.log(rawQuestions[0].id);
      const questionObjects = rawQuestions.map((rawQuestion) => ({
        id: rawQuestion.id,
        type: rawQuestion.type,
        question: rawQuestion.question,
      }));
      console.log(questions);
      setQuestions(questionObjects);
    }).catch((error) => {
      console.error(error);
    });
  })
  // const submitForm = () => {
  //   axios.post('http://localhost:3001/api/insert', {
  //     formData: questions
  //   }).then(() => {
  //     alert('successful insert')
  //   });
  // }
  return (
    <div className="App">
      <header>Form Submitter</header>
      <ResponseQuestions data={questions} ></ResponseQuestions>
      <button >Submit Form</button>
    </div>
  );
}

export default ResponseApp;
